import React,{ useState } from 'react';
import './Services.css';
import ReactDOM from 'react-dom';



const Services = (props) => {

const handleClick = (event) => {
  event.preventDefault(); 
  props.setShowApp(true);
  // console.log("hello");
};


  return (
    <section className="services" id="services">

      <h1 className="heading"> our <span>services</span> </h1>

      <div className="box-container">

        <div className="box">
          <i className="fas fa-notes-medical"></i>
          <h3>free checkups</h3>
          <a href='#book' className="btn"> learn more <span className="fas fa-chevron-right"></span> </a>
        </div>

        <div className="box">
          <i className="fas fa-gamepad"></i>
          <h3>free fun games </h3>
          <a href="https://www.crazygames.com/t/candy" className="btn"> Explore games<span className="fas fa-chevron-right"></span> </a>
        </div>

        <div className="box">
          <i className="fas fa-user-md"></i>
          <h3>expert doctors</h3>
          <a href="#doctors" className="btn"> learn more <span className="fas fa-chevron-right"></span> </a>
        </div>

        <div className="box">
          <i className="fas fa-video"></i>
          <h3>Talk to experts</h3>
          <a href="#" className="btn"> learn more <span className="fas fa-chevron-right"></span> </a>
        </div>

        {/* <div className="box">
          <i className="fas fa-procedures"></i>
          <h3>Doctor Review</h3>
          <a href="#review" className="btn"> Check Reviews <span className="fas fa-chevron-right"></span> </a>
        </div> */}

        <div className="box">
          <i className="fas fa-notes-medical"></i>
          <h3>Self-analysis for depression</h3>
          <a href="http://127.0.0.1:5501/" className="btn"> Check <span className="fas fa-chevron-right"></span> </a>
        </div>

        <div className="box" onClick={handleClick}>
          <i className="fas fa-notes-medical"></i>
          <h3>Take a quiz</h3>
          <a href="" className="btn"> Check <span className="fas fa-chevron-right"></span></a>
        </div>

      </div>

    </section>
  );
}

export default Services;
